INSERT INTO `album_items` VALUES (53,1,4928,'Interfaz intuitiva','La app cuenta con una interfaz intuitiva que permite al usuario navegar fácilmente por todas las funciones y características de la aplicación',1,'2023-04-01 22:10:25','2023-04-01 16:45:46'),(54,1,4927,'Diseño moderno','El diseño moderno de la app atrae a los usuarios y les brinda una experiencia de uso agradable y actualizada.',1,'2023-04-01 22:10:25','2023-04-01 16:45:46'),(55,1,4926,'Personalización a tu medida','La app ofrece múltiples opciones de personalización para que cada usuario pueda adaptarla a sus necesidades y preferencias individuales.',1,'2023-04-01 22:10:25','2023-04-01 16:45:46'),(56,1,4925,'Facilidad de uso','La app fue diseñada para ser fácil de usar, lo que significa que los usuarios pueden acceder a todas sus funciones sin tener que pasar por procesos complicados o confusos.',1,'2023-04-01 22:10:25','2023-04-01 16:45:46');
