INSERT INTO `events` VALUES (1,' ¡Únete a la revolución de la app!','Descubre la nueva forma de simplificar tu vida con nuestra última crea','<p>&nbsp;&iexcl;Es hora de celebrar! Estamos emocionados de anunciar el lanzamiento de nuestra nueva aplicaci&oacute;n que revolucionar&aacute; la forma en que realizas tus actividades diarias. Ven y &uacute;nete a nosotros en nuestro evento de lanzamiento donde podr&aacute;s ser el primero en probar nuestras nuevas funciones y caracter&iacute;sticas. Aprovecha esta oportunidad para conocer a nuestro equipo, compartir tus comentarios y obtener descuentos exclusivos en la suscripci&oacute;n de la aplicaci&oacute;n.</p>\n<p>Direcci&oacute;n: Te esperamos el pr&oacute;ximo s&aacute;bado 15 de mayo en el Centro de Convenciones de la ciudad, ubicado en la calle principal #123. El evento comenzar&aacute; a las 10:00 a.m. y tendremos una variedad de actividades emocionantes preparadas para ti. &iexcl;No te lo pierdas!</p>','Centro de Convenciones de la ciudad, ubicado en la calle principal #123',1,4925,0,1,'2023-04-01 19:28:17','2023-04-01 22:28:17','2023-04-01 17:28:17',1);
