dia.org/wiki/FreeCodeCamp\">freeCodeCamp</a>&nbsp;(almost 312,000 stars) and marginally behind&nbsp;<a href=\"https://en.wikipedia.org/wiki/Vue.js\">Vue.js</a>&nbsp;framework.</p>\n<!-- /wp:paragraph -->',NULL,1,1,1,0,0,2,'default',1344,NULL,'2020-12-05 22:41:02',NULL,'2020-12-05 22:41:02',NULL),(123,'hire-me','default','Hire me','','<form id=\"iphorm-6112eedcd2be1\" class=\"iphorm iphorm-form-5\" action=\"/hire-me#iphorm-6112eedcd2be1\" method=\"post\" enctype=\"multipart/form-data\">\n        <div class=\"iphorm-inner iphorm-inner-5\">\n            <input type=\"hidden\" name=\"iphorm_id\" value=\"5\">\n            <input type=\"hidden\" name=\"iphorm_uid\" value=\"6112eedcd2be1\">\n            <input type=\"hidden\" name=\"form_url\" value=\"http://janne.me/hire-me\">\n            <input type=\"hidden\" name=\"referring_url\" value=\"http://janne.me/contact\">\n            <input type=\"hidden\" name=\"post_id\" value=\"21\">\n            <input type=\"hidden\" name=\"post_title\" value=\"Hire me\">\n                                                <div class=\"iphorm-elements iphorm-elements-5 iphorm-clearfix\">\n                \n<h2>Questionnaire</h2>\nRequesting an estimate for a project only takes a few minutes of your time and costs absolutely nothing. This questionnaire was built to help me identify your needs for the project.<br><br>\n\nAfter you click the send button, I will send you an estimate for a review. Also take a look at my <a href=\"http://janne.me/hire-me/faq\">Frequently Asked Questions</a>.<br><br><br>\n<div class=\"iphorm-group-wrap iphorm_5_1-group-wrap iphorm-clearfix iphorm-labels-above iphorm-group-style-plain iphorm-group-alignment-proportional\">\n    <div class=\"iphorm-group-elements\">\n                <div class=\"iphorm-group-row iphorm-clearfix iphorm-group-row-2cols\"><div class=\"iphorm-element-wrap iphorm-element-wrap-text iphorm_5_3-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"i