nterfaces of the site for additional devices do require more work. You can read a short summary <a rel=\"lightbox\" href=\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\">What is Responsive Design and why do we need it?</a> from my FAQ.</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n</div><div class=\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_38-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_38-element-spacer\">\n                    <label for=\"iphorm_5_38_6112eedcd2be1\">\n                <strong>Timeline</strong>. When do you need this completed by?                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_38-input-wrap\">\n            <div class=\"selector fixedWidth\" id=\"uniform-iphorm_5_38_6112eedcd2be1\"><span style=\"user-select: none;\">Please choose one…</span><select class=\"iphorm-element-select  iphorm_5_38\" name=\"iphorm_5_38\" id=\"iphorm_5_38_6112eedcd2be1\">\n                                    <option value=\"Please choose one…\">Please choose one…</option>\n                                    <option value=\"As soon as possible\">As soon as possible</option>\n                                    <option value=\"Within 3 weeks\">Within 3 weeks</option>\n                                    <option value=\"Within 6 weeks\">Within 6 weeks</option>\n                                    <option value=\"Within 12 weeks\">Within 12 weeks</option>\n                                    <option value=\"When you\'re available, let me know\">When you\'re available, let me know</option>\n                            </select></div>\n                <p class=\"iphorm-description\">I generally recommend at least three weeks for most projects, to ensure that the appropriate research and creative output is the best it can be.</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n</div><div class=\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_54-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\" style=\"display: none;\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_54-element-spacer\">\n                    <label for=\"iphorm_5_54_6112eedcd2be1\">\n                <strong>Budget</strong>. How much are you planning to invest in the project? (USD, Including Responsive)                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_54-input-wrap\">\n            <div class=\"selector fixedWidth\" id=\"uniform-iphorm_5_54_6112eedcd2be1\"><span style=\"user-select: none;\">Please choose one…</span><select class=\"iphorm-element-select  iphorm_5_54\" name=\"iphorm_5_54\" id=\"iphorm_5_54_6112eedcd2be1\">\n                                    <option value=\"Please choose one…\">Please choose one…</option>\n                                    <option value=\"< $2500\">&lt; $2500</option>\n                                    <option value=\"$2500 – $3500\">$2500 – $3500</option>\n                                    <option value=\"$3500 – $5000\">$3500 – $5000</option>\n                                    <option value=\"$5000 – $7500\">$5000 – $7500</option>\n                                    <option value=\"$7500 – $10,000\">$7500 – $10,000</option>\n                                    <option value=\"$10,000 +\">$10,000 +</option>\n                            </select></div>\n                <p class=\"iphorm-description\">Design isn\'t a commodity, meaning that you will get different costs from every designer. I listen to your specific needs first, and then put together a customized estimate based on these needs. Please provide a rough idea of what you are willing to invest, keeping in mind that the more you can invest, the more I can invest in your project. <br><br> From my FAQ: <br><a rel=\"lightbox\" href=\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\">How much does it cost to work with you?</a><br><a rel=\"lightbox\" href=\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\">How is the cost of your services determined?</a>\n</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n</div><div class=\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_37-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_37-element-spacer\">\n                    <label for=\"iphorm_5_37_6112eedcd2be1\">\n                <strong>Budget</strong>. How much are you planning to invest in the project? (USD)                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_37-input-wrap\">\n            <div class=\"selector fixedWidth\" id=\"uniform-iphorm_5_37_6112eedcd2be1\"><span style=\"user-select: none;\">Please choose one…</span><select class=\"iphorm-element-select  iphorm_5_37\" name=\"iphorm_5_37\" id=\"iphorm_5_37_6112eedcd2be1\">\n                                    <option value=\"Please choose one…\">Please choose one…</option>\n                                    <option value=\"< $1500\">&lt; $1500</option>\n                                    <option value=\"$1500 – $2500\">$1500 – $2500</option>\n                                    <option value=\"$2500 – $3500\">$2500 – $3500</option>\n                                    <option value=\"$3500 – $5000\">$3500 – $5000</option>\n                                    <option value=\"$5000 – $7500\">$5000 – $7500</option>\n                                    <option value=\"$7500 – $10,000\">$7500 – $10,000</option>\n                                    <option value=\"$10,000 +\">$10,000 +</option>\n                            </select></div>\n                <p class=\"iphorm-description\">Design isn\'t a commodity, meaning that you will get different costs from every designer. I listen to your specific needs first, and then put together a customized estimate based on these needs. Please provide a rough idea of what you are willing to invest, keeping in mind that the more you can invest, the more I can invest in your project. <br><br> From my FAQ: <br><a rel=\"lightbox\" href=\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\">How much does it cost to work with you?</a><br><a rel=\"lightbox\" href=\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\">How is the cost of your services determined?</a>\n</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n</div><div class=\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_27-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_27-element-spacer\">\n                    <label for=\"iphorm_5_27_6112eedcd2be1\">\n                Why is the site / redesign / project needed? Who is the audience?                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-textarea iphorm_5_27-input-wrap\">\n            <textarea class=\"iphorm-element-textarea  iphorm_5_27\" id=\"iphorm_5_27_6112eedcd2be1\" name=\"iphorm_5_27\" rows=\"5\" cols=\"25\" spellcheck=\"false\" data-ms-editor=\"true\"></textarea>\n                <p class=\"iphorm-description\">Is it a new site for an event or business, or an existing but outdated site in need of technical or visual upgrades? Information about target group; i.e. gender, age group, country, yearly income, profession, hobbies and interests is very helpful to narrow down the ideal audience.</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n    </div><div class=\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_30-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_30-element-spacer\">\n                    <label for=\"iphorm_5_30_6112eedcd2be1\">\n                What are the primary objectives and goals (long term and short term) for the project?                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-textarea iphorm_5_30-input-wrap\">\n            <textarea class=\"iphorm-element-textarea  iphorm_5_30\" id=\"iphorm_5_30_6112eedcd2be1\" name=\"iphorm_5_30\" rows=\"5\" cols=\"25\" spellcheck=\"false\" data-ms-editor=\"true\"></textarea>\n                <p class=\"iphorm-description\">Generate sales and leads? Get your business name out there to create stronger awareness for your brand? What do you want to achieve with my help?</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n    </div><div class=\"iphorm-group-wrap iphorm_5_50-group-wrap iphorm-clearfix iphorm-labels-above iphorm-group-style-plain iphorm-group-alignment-proportional\" style=\"display: none;\">\n    <div class=\"iphorm-group-elements\">\n                <div class=\"iphorm-group-row iphorm-clearfix iphorm-group-row-1cols last-child\"><div class=\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_29-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_29-element-spacer\">\n                    <label for=\"iphorm_5_29_6112eedcd2be1\">\n                <strong>Web Design</strong>. What are the key reasons users may have for visiting the site?                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-textarea iphorm_5_29-input-wrap\">\n            <textarea class=\"iphorm-element-textarea  iphorm_5_29\" id=\"iphorm_5_29_6112eedcd2be1\" name=\"iphorm_5_29\" rows=\"5\" cols=\"25\" spellcheck=\"false\" data-ms-editor=\"true\"></textarea>\n                <p class=\"iphorm-description\">Are the users coming to your site to find information about your company, an event, products, contact details or other information?</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n    </div>        </div> <!-- /.iphorm-group-row -->\n    </div> <!-- /.iphorm-group-elements -->\n</div> <!-- /.iphorm-group-wrap --><div class=\"iphorm-group-wrap iphorm_5_40-group-wrap iphorm-clearfix iphorm-labels-above iphorm-group-style-plain iphorm-group-alignment-proportional\" style=\"display: none;\">\n    <div class=\"iphorm-group-elements\">\n                <div class=\"iphorm-group-row iphorm-clearfix iphorm-group-row-1cols\"><div class=\"iphorm-element-wrap iphorm-element-wrap-radio iphorm_5_42-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-radio iphorm_5_42-element-spacer\">\n                    <label class=\"iphorm_5_42-outer-label\">\n                <strong>Web Development</strong>. Do you want the site to be static or dynamic?                                            </label>\n                <div class=\"iphorm-input-wrap iphorm-input-wrap-radio iphorm_5_42-input-wrap\">\n            <div class=\"iphorm-input-ul iphorm-input-radio-ul iphorm_5_42-input-radio-ul iphorm-options-inline iphorm-clearfix\">\n                            <div class=\"iphorm-input-li iphorm-input-radio-li iphorm_5_42-input-li\">\n                    <label class=\"iphorm_5_42_1_label\">\n                        <div class=\"radio\" id=\"uniform-iphorm_5_42_6112eedcd2be1_1\"><span><input class=\"iphorm-element-radio iphorm_5_42 iphorm_5_42_1\" type=\"radio\" name=\"iphorm_5_42\" id=\"iphorm_5_42_6112eedcd2be1_1\" value=\"Static HTML\"></span></div>\n                        Static HTML                    </label>\n                </div>\n                            <div class=\"iphorm-input-li iphorm-input-radio-li iphorm_5_42-input-li\">\n                    <label class=\"iphorm_5_42_2_label\">\n                        <div class=\"radio\" id=\"uniform-iphorm_5_42_6112eedcd2be1_2\"><span><input class=\"iphorm-element-radio iphorm_5_42 iphorm_5_42_2\" type=\"radio\" name=\"iphorm_5_42\" id=\"iphorm_5_42_6112eedcd2be1_2\" value=\"Dynamic with Content Management System\"></span></div>\n                        Dynamic with Content Management System                    </label>\n                </div>\n                        </div>\n                <p class=\"iphorm-description\">Static HTML sites need some knowlege with HTML language and text editors to update the site, texts, pictures etc. Dynamic CMS sites, ie. <a href=\"http://www.wordpress.org\" target=\"_blank\">WordPress</a>, <a href=\"http://www.joomla.org\" target=\"_blank\">Joomla</a>, <a href=\"http://www.drupal.org\" target=\"_blank\">Drupal</a> and so on, are much easier to use and update – and won\'t require any HTML knowlegde. But it requires more work to develop a site for a CMS platform, so it costs more.<br><br>My personal favorite is WordPress, highly customizable and ease of use for the end-users with other cool stuff.</p>\n        </div>\n        <div class=\"iphorm-errors-wrap iphorm-hidden\">\n    </div>    </div>\n</div></div><div class=\"iphorm-group-row iphorm-clearfix iphorm-group-row-1cols last-child\"><div class=\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_43-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\">\n    <div class=\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_43-element-spacer\">\n                    <label for=\"iphorm_5_43_6112eedcd2be1\">\n                Additional