need this completed by?                                            </label>\\n                <div class=\\\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_38-input-wrap\\\">\\n            <div class=\\\"selector fixedWidth\\\" id=\\\"uniform-iphorm_5_38_6112eedcd2be1\\\"><span style=\\\"user-select: none;\\\">Please choose one…</span><select class=\\\"iphorm-element-select  iphorm_5_38\\\" name=\\\"iphorm_5_38\\\" id=\\\"iphorm_5_38_6112eedcd2be1\\\">\\n                                    <option value=\\\"Please choose one…\\\">Please choose one…</option>\\n                                    <option value=\\\"As soon as possible\\\">As soon as possible</option>\\n                                    <option value=\\\"Within 3 weeks\\\">Within 3 weeks</option>\\n                                    <option value=\\\"Within 6 weeks\\\">Within 6 weeks</option>\\n                                    <option value=\\\"Within 12 weeks\\\">Within 12 weeks</option>\\n                                    <option value=\\\"When you\'re available, let me know\\\">When you\'re available, let me know</option>\\n                            </select></div>\\n                <p class=\\\"iphorm-description\\\">I generally recommend at least three weeks for most projects, to ensure that the appropriate research and creative output is the best it can be.</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n</div><div class=\\\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_54-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\\\" style=\\\"display: none;\\\">\\n    <div class=\\\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_54-element-spacer\\\">\\n                    <label for=\\\"iphorm_5_54_6112eedcd2be1\\\">\\n                <strong>Budget</strong>. How much are you planning to invest in the project? (USD, Including Responsive)                                            </label>\\n                <div class=\\\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_54-input-wrap\\\">\\n            <div class=\\\"selector fixedWidth\\\" id=\\\"uniform-iphorm_5_54_6112eedcd2be1\\\"><span style=\\\"user-select: none;\\\">Please choose one…</span><select class=\\\"iphorm-element-select  iphorm_5_54\\\" name=\\\"iphorm_5_54\\\" id=\\\"iphorm_5_54_6112eedcd2be1\\\">\\n                                    <option value=\\\"Please choose one…\\\">Please choose one…</option>\\n                                    <option value=\\\"< $2500\\\">&lt; $2500</option>\\n                                    <option value=\\\"$2500 – $3500\\\">$2500 – $3500</option>\\n                                    <option value=\\\"$3500 – $5000\\\">$3500 – $5000</option>\\n                                    <option value=\\\"$5000 – $7500\\\">$5000 – $7500</option>\\n                                    <option value=\\\"$7500 – $10,000\\\">$7500 – $10,000</option>\\n                                    <option value=\\\"$10,000 +\\\">$10,000 +</option>\\n                            </select></div>\\n                <p class=\\\"iphorm-description\\\">Design isn\'t a commodity, meaning that you will get different costs from every designer. I listen to your specific needs first, and then put together a customized estimate based on these needs. Please provide a rough idea of what you are willing to invest, keeping in mind that the more you can invest, the more I can invest in your project. <br><br> From my FAQ: <br><a rel=\\\"lightbox\\\" href=\\\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\\\">How much does it cost to work with you?</a><br><a rel=\\\"lightbox\\\" href=\\\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\\\">How is the cost of your services determined?</a>\\n</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n</div><div class=\\\"iphorm-element-wrap iphorm-element-wra