n invest in your project. <br><br> From my FAQ: <br><a rel=\\\"lightbox\\\" href=\\\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\\\">How much does it cost to work with you?</a><br><a rel=\\\"lightbox\\\" href=\\\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\\\">How is the cost of your services determined?</a>\\n</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n</div><div class=\\\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_27-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\\\">\\n    <div class=\\\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_27-element-spacer\\\">\\n                    <label for=\\\"iphorm_5_27_6112eedcd2be1\\\">\\n                Why is the site / redesign / project needed? Who is the audience?                                            </label>\\n                <div class=\\\"iphorm-input-wrap iphorm-input-wrap-textarea iphorm_5_27-input-wrap\\\">\\n            <textarea class=\\\"iphorm-element-textarea  iphorm_5_27\\\" id=\\\"iphorm_5_27_6112eedcd2be1\\\" name=\\\"iphorm_5_27\\\" rows=\\\"5\\\" cols=\\\"25\\\" spellcheck=\\\"false\\\" data-ms-editor=\\\"true\\\"></textarea>\\n                <p class=\\\"iphorm-description\\\">Is it a new site for an event or business, or an existing but outdated site in need of technical or visual upgrades? Information about target group; i.e. gender, age group, country, yearly income, profession, hobbies and interests is very helpful to narrow down the ideal audience.</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n    </div><div class=\\\"iphorm-element-wrap iphorm-element-wrap-textarea iphorm_5_30-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\\\">\\n    <div class=\\\"iphorm-element-spacer iphorm-element-spacer-textarea iphorm_5_30-element-spacer\\\">\\n                  